import React from "react"
import * as AiIcons from "react-icons/ai";
import {FcAbout} from "react-icons/fc";


export const SideMenu = [
    {
        title: 'Home',
        path: '/',
        icon: <AiIcons.AiFillHome />,
        className: 'nav-text'
    },
    {
        title: 'About',
        path: '/about',
        icon: <FcAbout />,
        className: 'nav-text'
    },
    {
        title: 'Registration',
        path: '/motoristRegistration',
        icon: <AiIcons.AiOutlineBook />,
        className: 'nav-text'
    }
]
